# print(filename)
dict = {}
for i in range(len(filename)):
    each = srcfilepath + '\\' + filename[i]
    f = open(each, 'r', encoding="utf-8")
    cont = f.readlines()
    # print(type(cont))
    # print(filename[i],cont)
    # print(filename[i],len(cont))
    key = filename[i].replace('.txt', " ")
    # key = filename[i]
    dict[key] = len(cont)
    f.close()
print(dict)
print(sorted(dict.items(),key = lambda item:item[1], reverse= True))
df = pd.DataFrame.from_dict(dict, orient='index',columns=['num'])
df = df.reset_index().rename(columns = {'index':'name'})
sorted_df = df.sort_values(by = 'num', ascending = False)
# sorted_df.reset_index(drop=True)
sorted_df.reset_index(drop=True).to_csv('B:\\code_master\\code\\01Preprocess\\AllChargeNum.csv'
                               ,encoding="utf_8_sig")
